-- We need each patients LSOA in order to look up their Townsend score and quintile.
-- >>> Ignoring following query as already injected: query-patient-lsoa.sql

-- Bring together #Patients table with LSOA and Townsend score/quintile
IF OBJECT_ID('tempdb..#PatientTownsend') IS NOT NULL DROP TABLE #PatientTownsend;
SELECT p.FK_Patient_Link_ID, Score AS TownsendScoreHigherIsMoreDeprived, Quintile AS TownsendQuintileHigherIsMoreDeprived
INTO #PatientTownsend
FROM #Patients p
LEFT OUTER JOIN #PatientLSOA lsoa ON lsoa.FK_Patient_Link_ID = p.FK_Patient_Link_ID
LEFT OUTER JOIN #TownsendLookup t ON t.LSOA = lsoa.LSOA_Code;

-- Tidy up - helpful in ensuring the tempdb doesn't run out of space mid-query
DROP TABLE #TownsendLookup;

-- >>> Following code sets injected: hypertension v1
SELECT FK_Patient_Link_ID AS PatientId, MIN(EventDate) AS DateOfFirstDiagnosis FROM [RLS].[vw_GP_Events]
WHERE (
  FK_Reference_Coding_ID IN (SELECT FK_Reference_Coding_ID FROM #VersionedCodeSets WHERE Concept = 'hypertension' AND Version = 1) OR
  FK_Reference_SnomedCT_ID IN (SELECT FK_Reference_SnomedCT_ID FROM #VersionedSnomedSets WHERE Concept = 'hypertension' AND Version = 1)
)
GROUP BY FK_Patient_Link_ID;